function Video(props) {
  let videoId = props.stepContent.split("=")[1].split("&")[0];
  console.log(videoId);
  return (
    <div>
      <iframe
        title="myFrame"
        id="player"
        type="text/html"
        width="640"
        height="360"
        src={"https://www.youtube.com/embed/" + videoId}
      ></iframe>
    </div>
  );
}
export default Video;
